import React, { useState } from 'react';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Inputfood from './com/Inputfood';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: theme.palette.common.gray,
    color: theme.palette.common.black,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 20,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
  '&:last-child td, &:last-child th': {
    border: 0,
  },
}));

function createData(name, calories, fat, carbs, protein, status) {
  return { name, calories, fat, carbs, protein, status };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0, 'ยังไม่กิน'),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3, 'ยังไม่กิน'),
  createData('Eclair', 262, 16.0, 24, 6.0, 'ยังไม่กิน'),
  createData('Cupcake', 305, 3.7, 67, 4.3, 'ยังไม่กิน'),
  createData('Gingerbread', 356, 16.0, 49, 3.9, 'ยังไม่กิน'),
];

export default function Statusfood() {
  const [statusData, setStatusData] = useState([]);
  const [inputValue, setInputValue] = useState('');
  const [selectedTime, setSelectedTime] = useState('');

  const handleSaveInputfood = (data) => {
    console.log('Saved Data from Inputfood:', data);
    const rowIndex = statusData.findIndex((row) => row.name === data.cowName);

    if (rowIndex !== -1) {
      const updatedStatusData = [...statusData];
      updatedStatusData[rowIndex] = { ...updatedStatusData[rowIndex], status: data.status, selectedTime: data.selectedTime };

      setStatusData(updatedStatusData);
    }
  };

  return (
    <div style={{ width: '100%', height: '100%', backgroundColor: 'EDEDED', boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)', borderRadius: '8px' }}>
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 700 }} aria-label="customized table">
          <TableHead>
            <TableRow>
              <StyledTableCell>ชื่อ</StyledTableCell>
              <StyledTableCell align="center">แท็ก</StyledTableCell>
              <StyledTableCell align="center">สถานะเช้า</StyledTableCell>
              <StyledTableCell align="center">สถานะเย็น</StyledTableCell>
              <StyledTableCell align="center">อาหาร</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <StyledTableRow key={row.name}>
                <StyledTableCell component="th" scope="row">
                  {row.name}
                </StyledTableCell>
                <StyledTableCell align="center">{row.fat}</StyledTableCell>
                <StyledTableCell align="center">{row.selectedTime === 'เช้า' ? 'กินแล้ว' : 'ยังไม่กิน'}</StyledTableCell>
                <StyledTableCell align="center">{row.selectedTime === 'เย็น' ? 'กินแล้ว' : 'ยังไม่กิน'}</StyledTableCell>
                <StyledTableCell align="center">
                  <Inputfood cowName={row.name} onSave={handleSaveInputfood} />
                </StyledTableCell>
              </StyledTableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}
